import { ArrowDropDown } from "@material-ui/icons";
import React from "react";
import "./navbar.css";

const Navbar = () => {
  const name = useSelector(stat)
  return (
    <div className="navbar">
      <div className="navbarWrapper">
        <div className="navbarLeft">
          <span className="logo">Asabi App</span>
          <span className="navbarLink">Home</span>
          <span className="navbarLink">About</span>
          <span className="navbarLink">Contact</span>
        </div>
        <div className="navbarCenter">
          <div className="search">
            <input
              type="text"
              placeholder="search for something..."
              className="searchInput"
            />
          </div>
        </div>
        <div className="navbarRight">
          <img
            className="avatar"
            src="https://raw.githubusercontent.com/OloriAsabi/book-images/main/src/me/IMG-4060.JPG?auto=compress&cs=tinysrgb&dpr=2&w=500"
            alt="" />
          <span className="navbarName"></span>
          <ArrowDropDown />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
